// components/Footer.js
import React from 'react';

const Footer = () => {
  return (
    <footer className="bg-dark text-white text-center py-3">
      <div className="container">
        <p className="m-0">&copy; 2025 My Company. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
